static INT32 uni2char(UINT16 uni, UINT8* out, UINT32 boundlen)
{
  UINT8* uni2charset;
  UINT8 cl = uni & 0xFF;
  UINT8 ch = (uni >> 8) & 0xFF;

  INT32 n;

  if (boundlen <= 0)
    return ERR_ML_NAME_TOO_LONG;

  uni2charset = (UINT8*)page_uni2charset[ch];
  if (uni2charset)
  {
    if (boundlen <= 1)
      return ERR_ML_NAME_TOO_LONG;
    out[0] = uni2charset[cl* 2];
    out[1] = uni2charset[cl * 2 + 1];
    if (out[0] == 0x00 && out[1] == 0x00)
      return ERR_ML_INVALID_CHARACTER;
    n = 2;
  }
  else if (ch == 0 && cl)
  {
    out[0] = cl;
    n      = 1;
  }
  else
    return ERR_ML_INVALID_CHARACTER;

  return n;
}

static INT32 char2uni(UINT8* rawstring, UINT32 boundlen, UINT16* uni)
{
  UINT8 ch, cl;
  UINT16* charset2uni;
  INT32 n;

  if (boundlen <= 0)
    return ERR_ML_NAME_TOO_LONG;

  if (boundlen == 1)
  {
    *uni = rawstring[0];
    return 1;
  }

  ch = rawstring[0];
  cl = rawstring[1];

  charset2uni = (UINT16*)page_charset2uni[ch];
  if (charset2uni && cl)
  {
    *uni = charset2uni[cl];
    if (*uni == 0x0000)
      return ERR_ML_INVALID_CHARACTER;
    n = 2;
  }
  else
  {
    *uni = ch;
    n    = 1;
  }
  return n;
}

